import Layout from '../components/Layout'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'
import { faCannabis } from '@fortawesome/free-solid-svg-icons'
import { faJoint } from '@fortawesome/free-solid-svg-icons'
import { faBong } from '@fortawesome/free-solid-svg-icons'



const Index = () => (
    <Layout>
        <>
            <h1>The Menu</h1>
            <div id="icons">
                <div id="coffee">
                    <br />
                    <button type="button" className="btn btn-success" id="btn-weed"><FontAwesomeIcon icon={faCoffee} height="150px" width="150px" /></button>
                </div>

                <div id="cannabis">

                    <br />
                    <button type="button" className="btn btn-success" id="btn-weed"><FontAwesomeIcon icon={faCannabis} height="150px" width="150px" /></button>
                </div>
                <div id="joint">

                    <br />
                    <button type="button" className="btn btn-success" id="btn-weed"><FontAwesomeIcon icon={faJoint} height="150px" width="150px" />Pre-Rolls</button>
                </div>
                <div id="bong">
                    <FontAwesomeIcon icon={faBong} height="150px" width="150px" />
                    <br />
                    <button type="button" className="btn btn-success" id="btn-weed">Merch</button>
                </div>
                <br />
                <br />
            </div>
            <style jsx>
                {`
               h1 {
                   text-align: center;
                   margin-top: 10px;
                   text-decoration: underline;
               }
               #coffee {
                   color: brown;
                   display: inline-block;
                   margin-left: 19%;


               }
               #cannabis {
                   color: green;
                   display: inline-block;
                   margin-left: 15px;

               }
               #joint {
                   color: brown;
                   display: inline-block;
                   margin-left: 15px;

               }
               #bong{
                display: inline-block;
                margin-left: 15px;
                color: blue;

               } 
               #btn-weed {
                   display: flex;
                   margin-left: 35px;
                   margin-top: 5px;
                   margin-bottom: 3px;
               }

               `}
            </style>
        </>
    </Layout>
)

export default Index;
